app.get('/register', (req, res) => {
    res.render('register')
})

app.post('/register', async (req, res) => {
    const { name, email, password } = req.body
    let user = await userModel.findOne({ email })
    if (user) { res.render('login') }
    bcrypt.genSalt(10, (err, salt) => {
        bcrypt.hash(password, salt, async (err, hash) => {
            let user = await userModel.create({
                name,
                email,
                password: hash,
            })
            let token = jwt.sign({ email: user.email, id: user._id }, 'secret')
            res.cookie('token', token)
            res.redirect('/')
        })
    })
})


app.get('/login', (req, res) => {
    res.render('login')
})

app.post('/login', async (req, res) => {
    const { email, password } = req.body
    let user = await userModel.findOne({ email })
    if (!user) {
        res.redirect('register')
    }
    bcrypt.compare(password, user.password, (err, result) => {

        if (result) {
            let token = jwt.sign({ email: user.email, id: user._id }, 'secret')

            res.cookie('token', token)

            res.redirect('/')

        }
    })
})

app.get('/logout', isLoggedIn, (req, res) => {
    res.cookie('token', "")
    res.redirect('/')
})

app.get('/product/:id', async (req, res) => {
    let product = await productModel.find({ _id: req.params.id })
    let products = await productModel.find()

    res.render('product', { product: product[0] })
})
app.get('/cart', isLoggedIn, async (req, res) => {
    let user=await userModel.findOne({email:req.user.email})
    let cartProducts = await productModel.find({ _id: { $in: user.cart } });
    res.render('cart', { cartProducts });
})
app.get('/cart/:id', isLoggedIn, async (req, res) => {
    let user = await userModel.findOne({ email: req.user.email })
    user.cart.push(req.params.id)

    await user.save()
    res.redirect('/cart')


})
app.get('/delete/:id', isLoggedIn, async (req, res) => {
    let user = await userModel.findOne({ email: req.user.email })
    user.cart = user.cart.filter((item) => item != req.params.id)
    await user.save()
    res.redirect('/cart')

})

function isLoggedIn(req, res, next) {
    const token = req.cookies.token
    if (!token) {
        return res.redirect('/login')
    }
    try {
        const data = jwt.verify(token, 'secret')
        req.user = data
        next()
    } catch (err) {
        res.redirect('/login')
    }
}

